import './App.css';
import Login from './modules/authenticate/login/login';
import NewRecipe from './modules/forms/newRecipe/newRecipe'
import Basic from './modules/forms/basic/basic'
import Download from './modules/forms/download/download'
import Home from './modules/pages/home/home'
import { Router, Routes, Route, BrowserRouter, Link } from 'react-router-dom';

function App() {
  return (

    <BrowserRouter>

      {/* <div className="App"> */}
        {/* <Login/> */}
        {/* <NewRecipe/> */}
        {/* <Download/> */}
      {/* </div> */}
      <div>
        <Link to="/">Home</Link>
      </div>
      <Routes>

        <Route path="/about">
          <About />
        </Route>
        <Route path="/download">
          <Download />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Routes>

    </BrowserRouter>

  );
}

export default App;
